  constructor(props){
    super(props);
    this.inc =  this.inc.bind(this.inc);
  }
  inc(){
    console.log('hi');
  }
    render(){
    return(
      <div className="CompContainer">
        <h2>Counter component</h2>
        <div className="counter_container">
         <button onClick={this.inc}>+</button>
         <h1>{this.props.name}</h1>

        </div>
      </div>
    )
  }
  }
